DROP TABLE IF EXISTS `document`;
CREATE TABLE `document` (
  `objectId` varchar(40) NOT NULL COMMENT 'Идентификатор',
  `createDate` datetime NOT NULL COMMENT 'Дата создания',
  `createUid` varchar(32) NOT NULL COMMENT 'Создал',
  `modifyDate` datetime NOT NULL COMMENT 'Дата модификации',
  `modifyUid` varchar(32) NOT NULL COMMENT 'Изменил',
  `deleteDate` datetime default NULL COMMENT 'Дата удаления',
  `deleteUid` varchar(32) default NULL COMMENT 'Удалил',
  `deleted` enum('false','true') NOT NULL default 'false' COMMENT 'Удален',
  `containerId` varchar(40) default NULL COMMENT 'Идентификатор раздела',
  `containerType` varchar(32) NOT NULL COMMENT 'Тип объекта контейнера',
  `chapterPath` varchar(150) NOT NULL COMMENT 'Раздел',
  `displayName` varchar(255) NOT NULL COMMENT 'Наименование',
  `description` varchar(255) NOT NULL COMMENT 'Описание',
  `keywords` varchar(255) NOT NULL COMMENT 'Ключевые слова',
  `docDate` date default NULL COMMENT 'Дата документа',
  `keyId` varchar(40) default NULL COMMENT 'Ключ',
  PRIMARY KEY  (`objectId`),
  UNIQUE KEY `keyId` (`keyId`),
  KEY `createDate` (`createDate`),
  KEY `containerId` (`containerId`,`deleted`,`displayName`),
  KEY `displayName` (`deleted`,`displayName`)
) ENGINE=INNODB DEFAULT CHARSET=utf8;
